import { TextStyle, Page, Layout } from '@shopify/polaris';

const Index = () => (
    <Page>
        <Layout>
            <TextStyle variation='positive'>
                Sample app by me
            </TextStyle>
        </Layout>
    </Page>
);

export default Index
